import React from 'react';
import './index.css';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";



function Navigation() {
  return (

    <Router>
        <Switch>

      <Route path="/about">
      <div>About1</div>
      </Route>
      <Route path="/users">
      <div>Users1</div>

      </Route>
      <Route path="/">
     <div> Home1</div>
      </Route>
        </Switch>

    </Router>



  );
}

export default Navigation;
